// export default App;
import React from 'react';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import SignUpPage from './pages/authentication/SignUpPage';
import LoginPage from './pages/authentication/LoginPage';
import HomePage from './pages/HomePage';
import ForgotPasswordPage from './pages/authentication/ForgotPasswordPage';
import ResetPasswordPage from './pages/authentication/ResetPasswordPage';
import VerificationSuccessPage from "./pages/authentication/VerificationSuccessPage";
import ProfilePage from "./pages/ProfilePage";
import VerificationFailedPage from "./pages/authentication/VerificationFailedPage";
import './styles/App.css'

// import Logout from './pages/Logout';

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/signup" component={SignUpPage}/>
                <Route path="/login" component={LoginPage}/>
                <Route path="/home" component={HomePage}/>
                <Route path="/verify" component={VerificationSuccessPage}/>
                <Route path="/error" component={VerificationFailedPage}/>
                <Route path="/forgot-password" component={ForgotPasswordPage}/>
                <Route path="/reset-password" component={ResetPasswordPage}/>
                <Route path="/profile" component={ProfilePage}/>
                {/*<Route path="/logout" component={Logout} />*/}
            </Switch>
        </Router>
    );
}

export default App;
